const namingSystemnic = {"resourceType":"NamingSystem","id":"nic","name":"Nic","status":"active","kind":"codesystem","date":"2019-03-20T15:00:00+11:00","publisher":"Elsevier.  Terminology owner: Center for Nursing Classification, College of Nursing, The University of Iowa.","description":"NIC provides names and values for procedures/orders/service intent related to the treatment activities of nurses and other providers who may perform the same treatment activities. Names, definitions, and associated codes are attached for 486 interventions. Defining activities (anywhere from ten to several dozen) are listed for each of the interventions in the NIC classification book but are not attached to this document.","uniqueId":[{"type":"uri","value":"https://nursing.uiowa.edu/cncce/nursing-interventions-classification-overview","preferred":true},{"type":"oid","value":"2.16.840.1.113883.6.15","preferred":false}]};